import React, { useState } from 'react';

const SearchPage = () => {
  const [searchTerm1, setSearchTerm1] = useState('');
  const [searchTerm2, setSearchTerm2] = useState('');
  const [searchTerm3, setSearchTerm3] = useState('');
  const [searchResults, setSearchResults] = useState([]);

  const handleSearch = () => {
    // Perform search logic here
    // Replace the code below with your own search implementation

    // Example search results
    const dummySearchResults = [
      { title: 'Sample Result 1', abstract: 'This is the abstract of sample result 1.' },
      { title: 'Sample Result 2', abstract: 'This is the abstract of sample result 2.' },
      { title: 'Sample Result 3', abstract: 'This is the abstract of sample result 3.' },
    ];

    setSearchResults(dummySearchResults);
  };

  return (
    <div>
      <h1>Search Page</h1>
      <input
        type="text"
        value={searchTerm1}
        onChange={(e) => setSearchTerm1(e.target.value)}
        placeholder="Enter search term 1"
      />
      <input
        type="text"
        value={searchTerm2}
        onChange={(e) => setSearchTerm2(e.target.value)}
        placeholder="Enter search term 2"
      />
      <input
        type="text"
        value={searchTerm3}
        onChange={(e) => setSearchTerm3(e.target.value)}
        placeholder="Enter search term 3"
      />
      <button onClick={handleSearch}>Search</button>

      <h2>Search Results</h2>
      {searchResults.length === 0 ? (
        <p>No results found.</p>
      ) : (
        searchResults.map((result, index) => (
          <div key={index}>
            <h3>{result.title}</h3>
            <p>{result.abstract}</p>
          </div>
        ))
      )}
    </div>
  );
};


const styles = {
  container: {
    maxWidth: '600px',
    margin: '0 auto',
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
  },
  title: {
    fontSize: '24px',
    marginBottom: '20px',
  },
  searchContainer: {
    display: 'flex',
    marginBottom: '20px',
  },
  input: {
    marginRight: '10px',
    padding: '5px',
    fontSize: '16px',
    borderRadius: '4px',
    border: '1px solid #ccc',
    flex: 1,
  },
  button: {
    padding: '5px 10px',
    fontSize: '16px',
    borderRadius: '4px',
    background: '#007bff',
    color: '#fff',
    border: 'none',
    cursor: 'pointer',
  },
  resultsTitle: {
    fontSize: '20px',
    marginBottom: '10px',
  },
  noResults: {
    fontStyle: 'italic',
    color: '#888',
  },
  resultContainer: {
    marginBottom: '20px',
  },
  resultTitle: {
    fontSize: '18px',
    marginBottom: '5px',
  },
  resultAbstract: {
    fontSize: '14px',
  },
};

export default SearchPage;
